#cleaning functions
def strip_col(file, axis):
    for col in file[axis]:
        col.strip("{}")
        col.strip("[]")
        col.strip(",")
        col.strip('""')
        print(col)

def strip_col_len(file):
    for index, row in file.head().iterrows():
        for col in file.iterrows():
            col.strip("{}")
            col.strip("[]")
            col.strip(",")
            col.strip('""')
            print(col)

def strip_col_tuple(file):
    for col in file.itertuples():
        col.strip("{}")
        col.strip("[]")
        col.strip(",")
        col.strip('""')
        print(col)


